INSERT INTO `discussion_comment` (`id`, `user_id`, `opinion_space_id`, `discussion_statement_id`, `comment`, `average_rating`, `average_score`, `score_sum`, `normalized_score`, `normalized_score_sum`, `confidence`, `blacklisted`, `is_current`, `query_weight`, `created`, `original_language`, `spanish_comment`, `translation_is_reviewed`) VALUES
(1, 1, 1, 2, 'I would like lots of clarity on the rubric for grading our assignments', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-10 21:26:09', 'english', '', 0),
(2, 2, 1, 2, 'I hope we receive plenty of feedback on what to improve from graders on our homework and exams.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-10 21:26:09', 'english', '', 0),
(3, 3, 1, 2, 'Can we post any required or suggested readings in advance, so we can look over them before lecture?', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-10 21:26:09', 'english', '', 0),
(4, 4, 1, 2, 'I really enjoy working in groups and am looking forward to that in this class', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-10 21:26:09', 'english', '', 0),
(5, 5, 1, 2, 'I find Piazza to be a really helpful and fast way for asking questions to instructors and classmates.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-10 21:26:09', 'english', '', 0),
(6, 10, 1, 2, 'I am not sure about how big the project will be and what will we be graded on about the project. Can the instructor provide a detailed rubric of the grading of the project?', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-18 15:45:00', 'english', '', 0),
(7, 17, 1, 2, 'I really like that we have an IEOR course on database. However, I feel that the labs are based on Microsoft Access, which has a very clean UI. I would like to gain more experience on more base databases, such as SQL commands, etc.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-19 17:20:45', 'english', '', 0),
(8, 32, 1, 2, 'I would like more hands-on activities/group activities during class.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-20 11:17:11', 'english', '', 0),
(9, 35, 1, 2, 'Please try and post the labs earlier so that we can get a head start reading and understanding them.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-20 12:46:48', 'english', '', 0),
(10, 58, 1, 2, 'I would like have some implantation problems using SQL', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-26 00:29:15', 'english', '', 0),
(11, 68, 1, 2, 'PLEASE include something about NoSQL databases. They are the future! At least mentioning some use cases and how they can be more useful than just traditional databases.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-26 11:39:14', 'english', '', 0),
(12, 74, 1, 2, 'More hands on experiences on Databases', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-26 11:42:07', 'english', '', 0),
(13, 109, 1, 2, 'Allowing webcasted lectures', NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, '2015-08-30 19:07:44', 'english', '', 0),
(14, 63, 1, 2, 'Suggest what techniques or IEOR topics that are a "prerequisite" to this course during class, so that student''s can examine them further.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-08-30 23:07:10', 'english', '', 0),
(15, 49, 1, 2, 'Add Lecture overview', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-09-02 11:06:08', 'english', '', 0),
(16, 88, 1, 2, 'In the future it would be helpful to give more of a window to get a company on board for the project initially. Perhaps send out an email before the class meets to give those who need extra time to find an organization more breathing room.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-09-02 11:08:48', 'english', '', 0),
(17, 111, 1, 2, 'I think it would be helpful to have note-takers for each class like we did in 170 last semester. This way, lecture notes could be posted on bCourses.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 1, '2015-09-02 11:09:00', 'english', '', 0),
(18, 67, 1, 2, 'It would be helpful if students take turns writing up notes and posting them for the whole class (similar to what was done in IEOR 170).', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-09-02 11:09:07', 'english', '', 0),
(19, 109, 1, 2, 'Be more open to other method of learning (i.e people who struggle following along to a fast paced lecture)', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-09-02 22:49:09', 'english', '', 0),
(20, 62, 1, 2, 'Expectations for the project should be presented before we start making teams. In my opinion this would mentally prepare us for what''s to come.', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, '2015-09-03 00:07:01', 'english', '', 0),
(21, 112, 1, 2, 'it would be nice to know approximately how the diagrams are going to look before we start drawing them so we know where to leave space', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 1, '2015-09-03 17:05:45', 'english', '', 0);
